import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Referee from "../Referee/Referee";

export default function Dashboard() {
  return (
    <Router>
      <Routes>
        <Route path="/referee" element={<Referee />} />
      </Routes>
    </Router>
  );
}
